import React from 'react'
import { Button } from '@mui/material';

export function ResetButton({minutes}) {

    const min = useState({minutes})

    const handleClickReset = () =>{
        alert(min)
    }

  return (
    <Button variant="contained" onClick={handleClickReset}>Reset</Button>
  )
}
